import React, { Component } from 'react';
import { NavLink } 			from 'react-router-dom';
import { Head5 } 			from '../styles/Head5'
import Title				from '../components/Title';
import { FaLaptopCode, FaPaintBrush, FaDatabase} from 'react-icons/fa'

export default class Information extends Component {

	state={
		proc: [
		{
			icon: <FaLaptopCode/>,
			titl: 'Front-end',
			deta: 'The goal of the Front End Web Developer Nanodegree program is to equip learners with the unique skills they need to build and develop a variety of websites and applications. Graduates of this Nanodegree program will be able to construct responsive websites using CSS, Flexbox and CSS Grid, develop interactive websites and UI (User Interface) applications using JavaScript and HTML, and connect a web application.'
		},
		{
			icon: <FaPaintBrush/>,
			titl: 'Graphic Design',
			deta: 'Capture attention with beautiful, high-impact visuals. Adjust clarity, color and tone and create image manipulation effects or perfect your graphic design work. Take your pictures to the next level with the most powerful image editing software for web, desktop, and mobile. Whether you are a novice or pro photographer, designer or artist, you will have the tools to take all your projects to the next level.'
		},
		{
			icon: <FaDatabase/>,
			titl: 'Programming',
			deta: 'Visual Basic (or VB) is a programming language developed by Microsoft that runs on the .Net Framework. With Visual Basic you can build Windows applications, web applications and Windows phone applications. Programs developed in Visual Basic will only run on a Windows Operating System. Visual Basic is easy to learn, fun and powerful!'
		  	}
		]
	}


	render() {
		return (

		  <section className="about"> 

		  	<div className="how-about sect-more">

		  	<Title title="A little more about Me" />

		  	  <div className="abUs-img abUs-img-wrap"></div>

		  	    <Head5>   Experienced Web Developer with a demonstrated history of working in the non-profit
		  	    	organization management industry. Skilled in User Experience (UX), WordPress, 
		  	    	User Interface Design, Web Design, and HTML. In-depth knowledge of Visual Basic 
		  	    	programming. Alumni of the Grow with Google Developer Scholarship in 2018 and have 
		  	    	completed Udacity's Front-End Developer nanodegree. 
		  	    </Head5>

		  		<Head5>   I’m currently working on creating an online portfolio. Until that is finished, 
		  			feel free to browse my work on GitHub.  Get in touch with me if you think I’d be a good fit 
		  			for your next project. I offer the following services:
				</Head5>    

		  		<Head5>		Website design<br />			</Head5> 
				<Head5>		Front-end development<br />		</Head5> 
				<Head5>		Software development<br />		</Head5> 

		  	  </div>	

			  <div className="how-portfolio">
			  	<Title title="portfolio" />
			  	  <div className="portfolio-center">
			  	    {this.state.proc.map((item, index) => {
			  	    	return (
			  	    	<article key={index} className="portfolio">
			  	    		<span className="nav-link">{item.icon}</span>
			  	    		<h6 className="nav-link">{item.titl}</h6>
			  	    		<p>{item.deta}</p>
			  	    	</article>
			  	    	);
			  	    })}
			  </div>
			</div>

		  </section>

		);
	}
}
